import pandas as pdimport requestsimport numpy as npfrom bs4 import BeautifulSoupdef rek(page):    headers={"*"}    url= f"https://www.glassdoor.com/Job/canada-data-analyst-jobs-SRCH_IL.0,6_IN3_KO7,19_IP{page}.htm?includeNoSalaryJobs=true&pgc=AB4AAYEAHgAAAAAAAAAAAAAAAeSKiWIAQgEBAQwNPjDK9loBUx5ZAaZfo9VwuJPIWSejgsUR9hcT5uXZc1OlTchZ6v6oNohAiuiccK%2BQchLDg2ReSGjHMdgGqgAA"    r=requests.get(url,headers)    soup= BeautifulSoup(r.content,"html.parser")    return soupdef collect(soup):    divs=soup.find_all("li",class_="react-job-listing")    for item in divs:        company=item.find("a",{"class","job-search-key-l2wjgv"}).text        title= item.find("a",{"data-test":"job-link"}).text        location= item.find("span",{"class":"css-1buaf54"}).text        publish_time=item.find("div",{"data-test":"job-age"}).text                        try:                        salary= item.find("span",{"data-test":"detailSalary"}).text.strip()        except:            salary="No Ä°nformation"                information={            "Company Name":company,            "Title":title,            "Location":location,            "Publish Time":publish_time,            "Salary":salary}        joblist.append(information)                                            return joblist=[]for i in range(0,5,1):    collect(rek(i))    df=pd.DataFrame(joblist)df.to_csv("glasdoor_jobs.csv")                        